import React from 'react';
import "./Home.css";
import headshot from './assets/profile-pic.jpg';
import linkedin from './assets/linkedin.png';
import github from './assets/github.png';

const Home = () => (
    <section className="home">
        <div className="home-container">
            <div className="right-side">
                <img src={headshot} alt="Toni's headshot" />
            </div>
            <div className="left-side">
                <h3>Hello my name</h3>
                <h1>Antonio Mendoza</h1>
                <h3>Computer Science Student at University of Georgia</h3>
                <button className="link-btn"><img className="logo" src={linkedin} alt="linkedin button"/> LinkedIn</button>
                <button className="link-btn"><img className="logo" src={github} alt="github button"/>Github</button>
            </div>
        </div>
    </section>
);

export default Home;
